import React from "react"
import {Badge,Row,Col,Stack} from "react-bootstrap"
import "./item.css"


export default function Item({items}){
    return (
        <Stack>
        {items && items.map(item => (
            <div className="restaurant" key={item.id}>
            <Col>
                <Row>
                <div className="d-flex align-items-center">
                {item.name} 
                {item.cuisines && item.cuisines.map((name,index) => (
                    <Badge bg="info" className="ms-2" key={index}>{name}</Badge>
                ))}
              </div>
                </Row>
                <Row>{item.address.city},{item.address.firstLine} </Row>
            </Col>
            <Col>{item.rating.starRating}</Col>
        </div>
        ))}
        </Stack>
        
       
   )
    
}
